class BookMark extends HTMLElement {
  constructor() {
    super();


    // We attach an open shadow root to the custom element
    this.sdwroot = this.attachShadow({mode: 'open'});

    // We define some inline styles using a template string


    const styles = `
            :host { 
              display: block;
              width: 300px;
              height: 200px;
              background-color: red;
            }
            .wrapper{
              position: absolute;
              width: 300px;
              height: 200px;
            }
            .outer {
              position: relative;
            }
            
            .closecircle{
            position: absolute;
              top: 10px;
              right: 20px;
              z-index: 2;
              
              height: 25px;
              width: 25px;
              background-color: #bbb;
              border-radius: 50%;
              display: inline-block;
              opacity: 0.6;
            }
            .close {
              position: absolute;
              top: 10px;
              right: 25px;
              z-index: 3;
            }
            .close img{
              margin-top: 4px;
             mergin-left: -5px;
              width: 16px;
              height: 16px;
            }
            .content {
              position: absolute;
              background-color: yellow;
              z-index: 1;
            }
            

            
            
            figure {
              font-family: 'Roboto', sans-serif;
              display: block;
              position: relative;
              float: left;
              overflow: hidden;
              margin: 0 20px 20px 0;
              border: 1px solid black;
              width: 100%;
              height: 100%;
              
            }
            figure img{
              width: 100%;
              height: 100%;
            }
            figcaption {
              position: absolute;
              background: black;
              background: rgba(0,0,0,0.75);
              color: white;
              padding: 10px 20px;
              opacity: 0;
              -webkit-transition: all 0.6s ease;
              -moz-transition:    all 0.6s ease;
              -o-transition:      all 0.6s ease;
              width: 100%;
              height: 50%;
            }
            figure:hover figcaption {
              opacity: 1;
            }
          .cap-left figcaption { bottom: 0; left: -30%; }
          .cap-left:hover figcaption { left: 0; }
          .cap-right figcaption { bottom: 0; right: -30%; }
          .cap-right:hover figcaption { right: 0; }
          .cap-top figcaption { left: 0; top: -30%; }
          .cap-top:hover figcaption { top: 0; }
          .cap-bot{z-index: 1}
          .cap-bot figcaption { left: 0; bottom: -30%;}
          .cap-bot:hover figcaption { bottom: 0; }
          

`;


    // We provide the shadow root with some HTML
    this.sdwroot.innerHTML = `<style>${styles}</style>`;


  }

  static get observedAttributes() {
    return ['href', 'src'];
  }
get dataid(){
  return this.getAttribute('data-id');
}

  get href() {
    console.log('gethref');
    return this.getAttribute('href');
  }

  set href(newValue) {
    this.setAttribute('href', newValue);
  }

  get src() {
    console.log('getsrc');
    return this.getAttribute('src');
  }

  set src(newValue) {
    this.setAttribute('src', newValue);
  }

  deleteBookmark(event){
    console.log('recieved delete');

    fetch(`api/bookmarks/${event.target.id}`, {method: 'delete'}).then(response => {
      console.log(response);
      window.location.reload(true);
    });
  }


  connectedCallback() {

    const tmpl = `
            <div class="outer">
              <div class="closecircle"></div>
              <div class="close"><img src="data:image/png;base64," id="${this.dataid}" /></div>
              <div class="content">
              <figure >
                <a href="${this.href}">
                  <img src="${this.src}" class="bookmark">
                  <figcaption>${this.href}</figcaption>
                </a>
              </figure>
              </div>
            </div>
            `;
    this.sdwroot.innerHTML += tmpl;
    this.addClickEvent();
  }

  addClickEvent(){
    let closebtn = this.sdwroot.querySelector('.close')
    closebtn.addEventListener('click', this.deleteBookmark);
  }
}

// This is where the actual element is defined for use in the DOM
customElements.define('book-mark', BookMark);

